import React, { Component } from "react";

class Counter extends Component {
  state = {
    counter: 0
  };

  handleClick = () => {};

  render() {
    const { counter } = this.state;

    return (
      <div>
        <div>{counter}</div>
        <button onClick={this.handleClick}>+1</button>
      </div>
    );
  }
}

export default Counter;
